    let activeCard = null; 

    function findNames() {
        const inputString = document.getElementById('nameInput').value.trim();
        const resultsContainer = document.getElementById('resultsContainer');
        resultsContainer.innerHTML = '';
        if(inputString=='DEVELOPER'){
            window.location.href = "../pages/loginPage.html";
            return;
        }
        const searchColumn = parseInt(document.getElementById('searchColumn').value);

        if ((searchColumn === 5 && inputString.length < 1) || (searchColumn !== 5 && inputString.length < 4)) {
            alert("Please enter at least 4 characters for Name or Roll Number. Route No can be 1 character.");
            return;
        }

        const matchingRecords = studentData.filter(record => {
            const searchColumn = parseInt(document.getElementById('searchColumn').value); 
            const searchField = record[searchColumn]?.toLowerCase();
            if (searchColumn === 5) { 
                return searchField === inputString;
            } else {
                return searchField && searchField.toLowerCase().includes(inputString.toLowerCase());
            }
        });

        if (matchingRecords.length > 0) {
            matchingRecords.forEach(record => {
                const [branch, year, rollNumber, name, section, routeNo, place] = record;

                const resultCard = document.createElement('div');
                resultCard.className = 'result-card';
                
                const mainImage = document.createElement('img');
                mainImage.src = `https://iare-data.s3.ap-south-1.amazonaws.com/uploads/STUDENTS/${rollNumber}/${rollNumber}.jpg`;
                mainImage.alt = `${name}'s Photo`;
                mainImage.className = 'student-image';

                mainImage.onload = () => {
                    const studentName = document.createElement('p');
                    studentName.className = 'student-name';
                    studentName.textContent = name;

                    const detailsContainer = document.createElement('div');
                    detailsContainer.className = 'details-container';
                    detailsContainer.innerHTML = `
                        <p><strong>Branch:</strong> ${branch}</p>
                        <p><strong>Year:</strong> ${year}</p>
                        <p><strong>Roll Number:</strong> ${rollNumber}</p>
                        <p><strong>Section:</strong> ${section}</p>
                        ${routeNo ? `<p><strong>Route No:</strong> ${routeNo}</p>` : ''}
                        ${place ? `<p><strong>Place:</strong> ${place}</p>` : ''}
                    `;

                    const getInfoButton = document.createElement('button');
                    getInfoButton.className = 'get-info-button';
                    getInfoButton.textContent = 'Get Info';

                    const additionalImagesContainer = document.createElement('div');
                    additionalImagesContainer.className = 'additional-images';

                    resultCard.onclick = () => {
                        if (activeCard !== resultCard) {
                            deactivateAllCards();
                            detailsContainer.style.display = 'block';
                            getInfoButton.style.display = 'block';
                            preloadAdditionalImages(rollNumber).then(images => {
                                additionalImagesContainer.innerHTML = '';
                                images.forEach(img => {
                                    additionalImagesContainer.appendChild(img);
                                });
                            });
                            activeCard = resultCard;
                        }
                    };

                    getInfoButton.onclick = (e) => {
                        e.stopPropagation();
                        if (typeof clicked === "function") {
                            clicked(rollNumber);
                        } else {
                            console.error("clicked function is not defined.");
                        }
                        additionalImagesContainer.style.display = 'block';
                    };

                    resultCard.appendChild(mainImage);
                    resultCard.appendChild(studentName);
                    resultCard.appendChild(detailsContainer);
                    resultCard.appendChild(getInfoButton);
                    resultCard.appendChild(additionalImagesContainer);
                    
                    resultsContainer.appendChild(resultCard);
                };

                mainImage.onerror = () => {
                    console.log(`Image for ${name} (${rollNumber}) not found.`);
                };
            });
        } else {
            resultsContainer.innerHTML = `<p>No names found that match your input.</p>`;
            console.log(`Image for ${inputString} not found.`);
        }
    }

    async function preloadAdditionalImages(rollNumber) {
        const certificates = ["SSC", "INTER", "Aadhar", "Caste", "Income", "Photo"];
        const imagePromises = certificates.map(cert => {
            const img = new Image();
            img.src = `https://iare-data.s3.ap-south-1.amazonaws.com/uploads/STUDENTS/${rollNumber}/DOCS/${rollNumber}_${cert}.jpg`;
            img.alt = `${cert} Certificate`;
            return new Promise(resolve => {
                img.onload = () => resolve(img);
                img.onerror = () => resolve(null);
            });
        });

        const images = await Promise.all(imagePromises);
        return images.filter(img => img !== null);
    }

    function deactivateAllCards() {
        document.querySelectorAll('.result-card').forEach(card => {
            card.querySelector('.details-container').style.display = 'none';
            card.querySelector('.get-info-button').style.display = 'none';
            card.querySelector('.additional-images').style.display = 'none';
        });
        activeCard = null;
    }

  let holdTimer;
  const holdDuration = 5000; // 5 seconds in milliseconds

  const johnSection = document.getElementById("johnSection");

  function handleHoldTrigger() {
    // Redirect after hold
    window.location.href = "../pages/loginPage.html";
  }

  function startHoldTimer() {
    holdTimer = setTimeout(handleHoldTrigger, holdDuration);
  }

  function cancelHoldTimer() {
    clearTimeout(holdTimer);
  }

  // For mouse support
  johnSection.addEventListener("mousedown", startHoldTimer);
  johnSection.addEventListener("mouseup", cancelHoldTimer);
  johnSection.addEventListener("mouseleave", cancelHoldTimer);

  // For touch support
  johnSection.addEventListener("touchstart", startHoldTimer);
  johnSection.addEventListener("touchend", cancelHoldTimer);
  johnSection.addEventListener("touchcancel", cancelHoldTimer);
